import React from "react";

const App = () => {
  return (
    <div className="full-container">
      <aside className="side-bar"></aside>
      <main className="main">
        <section className="hero">
          <div>
            <div></div>
          </div>
        </section>
      </main>
    </div>
  );
};

export default App;
